Le spina bifida (du latin signifiant « épine fendue en deux ») est une malformation liée à un défaut de formation des arcs vertébraux, un défaut de fermeture du tube neural (système nerveux primitif - défaut de fermeture du neuropore postérieur) et une ouverture du canal médullaire en bas du dos durant la quatrième semaine de la vie embryonnaire. Le plus souvent, cette malformation concerne l'extrémité caudale et donc la région sacrée, voire lombaire ; il en résulte l'absence de l'apophyse épineuse d'une ou plusieurs vertèbres. La protrusion des méninges par cette ouverture donne un méningocèle. De gravité variable, ces malformations vont du spina bifida occulta, très majoritairement non diagnostiqué et bénin ou entraînant des troubles légers, au myéloméningocèle, lorsqu'il y a protrusion de moelle spinale avec les méninges. Le spina bifida aperta non occulta, qui regroupe le myéloméningocèle, le méningocèle et le spina bifida à moëlle ouverte, concerne cinq naissances sur 10 000. Les nerfs lombo-sacrés, qui sont affectés par le spina bifida, participent normalement : 
* aux fonctions musculaires (hanche, cuisse, genou, jambe, pied) ; 
* à la motricité digestive ; 
* au contrôle vésical (innervation de la vessie et de ses sphincters) et anal (sphincter anal) ; 
* aux fonctions génitales (masculines et féminines).
